import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './registerForm.css'

const RegisterForm = () => {
    const [firstName, setFirstName] = useState(null);
    const [lastName, setLastName] = useState(null);
    const [username, setUsername] = useState(null);
    const [email, setEmail] = useState(null);
    const [password,setPassword] = useState(null);
    const [confPassword,setConfPassword] = useState(null);
  return (
   <div className='registerForm'>
      <div className='registerForm-wrapper'>
          <div className='registerForm-header'>
            <h1 className='register-header'>Sign-Up Now</h1>
            <p>Thank you for retruning, Please login below to continue</p>
          </div>

          <form method='post'  id='form'>
            <input type='text' name='firstName' placeholder=' First name ...' value={firstName} onChange = {(e) => handleInputChange(e)} required />
            <input type='text' name='lastName' placeholder=' Last name' value={lastName} onChange = {(e) => handleInputChange(e)} required />
            <input type='text' name='username' placeholder=' Username...' value={username} onChange = {(e) => handleInputChange(e)}  required />
            <input type='email' name='email' placeholder=' Email...' value={email} onChange = {(e) => handleInputChange(e)}  required />
            <input type='password' name='password' placeholder=' Password...' value={password} onChange = {(e) => handleInputChange(e)}  required />
            <input type='password' name='confPassword' placeholder='Confirm Password...' value={confPassword} onChange = {(e) => handleInputChange(e)}  required />
            <div className='loginBtn'>
               <input type='submit' value='Register'/>
            </div>
          </form>


          <Link to='/login'>Already have an account ? Login here</Link>


      </div>


   </div>
  )
}

export default RegisterForm;
